import React from 'react'

const Portfolio = (props) => {
    return (
        <>
          {console.log(props.info)}
          {props.info.map((item, index) => {
            return (
              <>
              <h1>{item.title}</h1>
              <p>{item.text}</p>
              <img src={item.image}/>
              </>
            )
          })}
        </>
    )
}

export default Portfolio
